    })
    .catch(err=>{
      console.log(err);
    })

    axios.post("http://localhost:5000/user/addFriend",{
      friendsEmail:"jatinbajaj2001@gmail.com",
      userId: "617ce19ca08f2465fa748cbf"
    }).then(res=>{
      console.log(res);
    })
    .catch(err=>{
      console.log(err);
    })
  })

  return (
   <>
   <BrowserRouter>
    <Dashboard/>
    </BrowserRouter>
   </> 
  )
}

export default App
